import { useContext, useEffect, useState } from 'react'
import './Footer.scss'

const Footer = ({ pageNumber, maxPage, jumpToPage }) => {

  useEffect(() => {  
    if (maxPage.includes('&q')) {
      maxPage = maxPage.split('&')[0]
    } 
  }, [maxPage])

  console.log(parseInt(pageNumber) > parseInt(maxPage))

  return (
    <footer className='footer' data-testid='footer'>
      { parseInt(pageNumber) > 1 && 
        <button 
          onClick={() => jumpToPage(parseInt(pageNumber) - 1)}>
          ←
        </button>
      }
      <p>{ pageNumber }</p>
      { parseInt(pageNumber) < maxPage && 
        <button 
          onClick={() => jumpToPage(parseInt(pageNumber) + 1)}>
          →
        </button>
      }
    </footer>
  )
}

export default Footer
